/*!50003 DROP PROCEDURE IF EXISTS  `pro_test3` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `pro_test3`()
begin
	declare i int default 1;
	while (i<=10) do
		insert into xxx_emp(empno,ename) value(i,concat('name',i));
		set i=i+1;
end while;
commit;
end */$$
DELIMITER ;

